{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/mdearafat/analyzing-user-behavior-for-bike-share-company?scriptVersionId=175559351\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"78ac75e9","metadata":{"papermill":{"duration":0.012391,"end_time":"2024-05-04T03:54:34.889087","exception":false,"start_time":"2024-05-04T03:54:34.876696","status":"completed"},"tags":[]},"source":["# <h1 style=\"font-family: Trebuchet MS; padding: 12px; font-size: 48px; color: #0F7375; text-align: center; line-height: 1.25;\"><b>Analyzing Chicago Bike-sharing Data (EDA) in<span style=\"color: #000000\"> 2024</span></b><br><span style=\"color: #0F7375; font-size: 18px\">using R programming, Google Sheets, and Divvy Trips dataset</span></h1>\n","\n","<font size=\"4\">**Welcome to the bike-share analysis case study! In this case study, we work for a transportation company, Divvy Bikes, along with some key team members. In order to answer the business questions, follow the steps of the data analysis process:** **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Ask</mark>**, **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Prepare</mark>**, **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Process</mark>**, **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Analyze</mark>**, **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Share</mark>**, **and** **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Act</mark>**</font>\n","\n","**Author: Md. Eyasen Arafat @ [Kaggle](https://www.kaggle.com/mdearafat), [LinkedIn](https://www.linkedin.com/in/mde-arafat/), [Tableau](https://public.tableau.com/app/profile/mde.arafat/vizzes), [Medium](https://medium.com/@mde_arafat)**\n","\n","**Notebook Version 1: 2024-04-29 02:30:00PM (GMT+6)**"]},{"cell_type":"markdown","id":"daa2c989","metadata":{"papermill":{"duration":0.011559,"end_time":"2024-05-04T03:54:34.912385","exception":false,"start_time":"2024-05-04T03:54:34.900826","status":"completed"},"tags":[]},"source":["<h3 style=\"font-family: Arial;background-color:#0F7375;color:white;text-align: center;padding-top: 7.5px;padding-bottom: 7.5px;border-radius: 15px 50px;letter-spacing: 2px;font-size: 20px\"><strong><centre>Introduction</centre></strong></h3>\n","\n","<font size=\"+1.5\" color=\"grey\"><b>1. </b></font><font size=\"+1.5\" color=\"#20B2AA\"><b>Divvy</b></font>\n","\n","<font size=\"4\">**A bike-share program that features more than 5,800 bicycles and 600 docking stations in Chicago. Divvy sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Divvy users are more likely to ride for leisure, but about 30% use the bikes to commute to work each day.**</font>\n","\n","<font size=\"+1.5\" color=\"grey\"><b>2. </b></font><font size=\"+1.5\" color=\"#20B2AA\"><b>Company Scenario</b></font>\n","\n","<font size=\"4\">**In 2016, Divvy launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.**</font>\n","\n","<font size=\"4\">**Until now, Divvy’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships.**</font>\n","- <font size=\"4\">**Customers who purchase single-ride or full-day passes are referred to as casual riders.**</font>\n","- <font size=\"4\">**Customers who purchase annual memberships are Divvy members.**</font>"]},{"cell_type":"markdown","id":"21f1590b","metadata":{"papermill":{"duration":0.01154,"end_time":"2024-05-04T03:54:34.936111","exception":false,"start_time":"2024-05-04T03:54:34.924571","status":"completed"},"tags":[]},"source":["<h3 style=\"font-family: Arial;background-color:#0F7375;color:white;text-align: center;padding-top: 7.5px;padding-bottom: 7.5px;border-radius: 15px 50px;letter-spacing: 2px;font-size: 20px\"><strong><centre>Business task</centre></strong></h3>\n","\n","<font size=\"4\">**Divvy’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Divvy attract more customers, Moreno (The director of marketing) believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a solid opportunity to convert casual riders into members. She notes that** **<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">casual riders are already aware of the Divvy program and have chosen Divvy for their mobility needs.**</mark></font>\n","\n","<font size=\"4\">**<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Moreno has set a clear goal:</mark>** **Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Divvy historical bike trip data to identify trends.**</font>\n","\n","<font size=\"+1.5\" color=\"#20B2AA\"><b>Three questions will guide the future marketing program:</b></font>\n","\n","- **How do annual members and casual riders use Divvy bikes differently?**\n","- **Why would casual riders buy Divvy annual memberships?**\n","- **How can Divvy use digital media to influence casual riders to become members?**\n","\n","<font size=\"4\">**<mark style=\"background-color:#0F7375;color:white;border-radius:5px;opacity:100\">Moreno has assigned me the first question to answer: How do annual members and casual riders use Divvy bikes differently?</mark>**</font>"]},{"cell_type":"markdown","id":"4cb9c289","metadata":{"papermill":{"duration":0.011461,"end_time":"2024-05-04T03:54:34.959171","exception":false,"start_time":"2024-05-04T03:54:34.94771","status":"completed"},"tags":[]},"source":["<h3 style=\"font-family: Arial;background-color:#0F7375;color:white;text-align: center;padding-top: 7.5px;padding-bottom: 7.5px;border-radius: 15px 50px;letter-spacing: 2px;font-size: 20px\"><strong><centre>Prepare Data ⊷</centre></strong></h3>\n","\n","<font size=\"+1.5\" color=\"grey\"><b>1. </b></font><font size=\"+1.5\" color=\"#20B2AA\"><b>Load Libraries</b></font>\n","\n","<font size=\"4\">**Firstly, we load the core Tidyverse package into this environment,**</font>\n","- **ggplot2:** for creating complex visualizations.\n","- **dplyr:** for data manipulation and wrangling.\n","- **tidyr:** for data tidying (arranging data in a specific format).\n","- **readr:** for importing data from various file formats.\n","- **purrr:** for functional programming in R.\n","- **tibble:** a modern data frame structure.\n","- **stringr:** for working with strings.\n","- **forcats:** for working with categorical variables."]},{"cell_type":"code","execution_count":1,"id":"dacfff96","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-05-04T03:54:34.98696Z","iopub.status.busy":"2024-05-04T03:54:34.984523Z","iopub.status.idle":"2024-05-04T03:54:36.292538Z","shell.execut